import React, { useState, useEffect } from 'react'
import { TextField, InputLabel, Container, Grid, Paper, Button, Typography } from '@material-ui/core';
import DeleteIcon from '@material-ui/icons/Delete'
import EditIcon from '@material-ui/icons/Edit';
import CloseIcon from '@material-ui/icons/Close'
import SaveIcon from '@material-ui/icons/Save'
import CancelIcon from '@material-ui/icons/Cancel'
import { api } from '../../COMPONENTS/axiosSetup';
import Navbar from '../../COMPONENTS/Navbar/Navbar';

const inputProps = {
    step: 1,
};
function AdminPage() {
    const [alertM, setAlertM] = useState(false)
    const [magac, setMagac] = useState('')
    const [sirta, setSirta] = useState('')
    const [role, setRole] = useState('')
    const [mess, setMess] = useState('')
    const [errM, setErrM] = useState(false)
    // async function postUsers(){
    //     console.log(role)
    //     if((magac !='' && sirta !='') && role !=''){
    //         const data = await (await api.post('/dir/admin/users', {magac, sirta, role})).data
    //         setMess(data)
    //         setAlertM(true)
    //         setSirta('')
    //         setMagac('')
    //         setRole('')
    //     }else{
    //       setErrM(true)
    //     }
    // }
    const [isticmaale, setIsticmaale] = useState([])
    // async function aqriUserska(){
    //     const data =  await (await api.get('/hel/userska')).data
    //     setIsticmaale(data)
    // }
    useEffect(()=>{
    //  aqriUserska()
    }, [])

    async function tirtiruser(id){
        await api.patch('/tirtir/user', {id})
        aqriUserska()
    }
  return (
    <>
    <Navbar />
    <div style={{  margin:'44px',  marginTop:'100px', marginLeft:'430px', height:'450px', width:"80%", overflowY:"scroll"}}>
        <Typography variant="h4" align='center'>DIIWAANGELI ISTICMAALE</Typography>
        {alertM && <Paper style={{width:'180px', height:'90px', position:'absolute', right:'30px', padding:'10px', display:'flex', justifyContent:'center', alignItems:'center', background:'green', color:'white'}} align='center' > <span style={{alignSelf:'flex-end', justifyContent:'flex-start'}}>{mess}</span> <CloseIcon onClick={()=>setAlertM(false)} titleAccess='xir'  style={{background:'red', alignSelf:'flex-start', cursor:'pointer'}}/> </Paper>}
        {errM && <Paper style={{width:'180px', height:'90px', position:'absolute', right:'30px', padding:'10px', display:'flex', justifyContent:'center', alignItems:'center', background:'red', color:'white'}} align='center' > <span style={{alignSelf:'flex-end', justifyContent:'flex-start'}}>BUUXI MEELAHA BANAAN</span> <CloseIcon onClick={()=>setErrM(false)} titleAccess='xir'  style={{background:'red', alignSelf:'flex-start', cursor:'pointer'}}/> </Paper>}

        <div style={{display:'flex', marginTop:'20px'}}>
        <Paper style={{width:"600px", height:'400px', padding:'20px', display:'flex', flexDirection:'column', justifyContent:'center', alignItems:'flex-start, '}}>
    <div style={{display:'flex', justifyContent:'flex-start', flexDirection:'column', width:'300px', height:'60px'}}>
        <label htmlFor="magac" style={{fontSize:'18px'}}>MAGAC ISTICMAALAHA</label>
        <input value={magac} required type="text" onChange={(e)=>setMagac(e.target.value)}  style={{width:"250px", height:'30px'}} />
    </div>
    <div style={{display:'flex', justifyContent:'flex-start', flexDirection:'column', width:'300px', height:'60px'}}>
        <label htmlFor="magac" style={{fontSize:'18px'}}>SIRTA</label>
        <input value={sirta} required type="password" onChange={(e)=> setSirta(e.target.value)} style={{width:"250px", height:'30px'}}  />
    </div>
    <div>
    <select value={role} onChange={(e)=> setRole(e.target.value)} required variant='outlined' style={{width:"auto", padding:'10px', background:'gray', borderRadius:'5px', color:'white', fontSize:'18px', cursor:'pointer', margin:'30px'}} name="supplier" id="supplier">
                <option value="">DOORO JAGO</option>
                <option value="CAHSIER">CAHSIER</option>
                <option value="ADMIN">ADMIN</option>
                </select>
    </div>
    <Button variant='outlined' style={{width:'100px', height:'40px', margin:'10px'}} type="submit" onClick={()=> {
        postUsers()
        setTimeout(()=>{
            aqriUserska()
        }, 1000)
    }}>KEYDI</Button>
        </Paper>
        <table style={{width:"400px", height:'50px', textAlign:'center'}}>
            <thead style={{fontSize:"20px", fontWeight:'bold'}}>
                <th>ID</th>
                <th>MAGACA</th>
                <th>ROLE</th>
                <th>ACTIONS</th>
            </thead>
            <tbody>
                {/* {isticmaale.map(istic=>{
                    return (
                <tr>
                    <td>{istic.id}</td>
                    <td>{istic.magaca}</td>
                    <td>{istic.role}</td>
                    <td><DeleteIcon onClick={()=> {
                        tirtiruser(istic.id)
                        aqriUserska()
                        }} style={{cursor:'pointer'}} /></td>
                </tr>

                    )
                })} */}
            </tbody>
        </table>
        </div>
    </div>
    </>
  )
}

export default AdminPage
